import React, { useState } from "react";
import "./styles.css";

const AdminDashboard = () => {
    const [users, setUsers] = useState([
        { name: "John Doe", email: "john@example.com", active: true },
        { name: "Jane Smith", email: "jane@example.com", active: true },
        { name: "Mike Johnson", email: "mike@example.com", active: true },
        { name: "Emily Davis", email: "emily@example.com", active: true },
        { name: "Chris Brown", email: "chris@example.com", active: true },
        { name: "Sarah Wilson", email: "sarah@example.com", active: true }
    ]);
    const [currentPage, setCurrentPage] = useState(1);
    const usersPerPage = 5;

    // Pagination logic
    const indexOfLastUser = currentPage * usersPerPage;
    const indexOfFirstUser = indexOfLastUser - usersPerPage;
    const currentUsers = users.slice(indexOfFirstUser, indexOfLastUser);
    const totalPages = Math.ceil(users.length / usersPerPage);

    const nextPage = () => setCurrentPage(currentPage < totalPages ? currentPage + 1 : currentPage);
    const prevPage = () => setCurrentPage(currentPage > 1 ? currentPage - 1 : currentPage);

    const toggleUserStatus = (index) => {
        const updatedUsers = [...users];
        updatedUsers[indexOfFirstUser + index].active = !updatedUsers[indexOfFirstUser + index].active;
        setUsers(updatedUsers);
    };

    const editUser = (index) => {
        const user = users[indexOfFirstUser + index];
        alert(`Edit user: ${user.name}`);
    };

    return (
        <div className="dashboard-container">
            {/* Sidebar Menu */}
            <nav className="sidebar">
                <h2>Admin Panel</h2>
                <ul>
                    <li>Dashboard</li>
                    <li>Users</li>
                    <li>Categories</li>
                    <li>Questions</li>
                    <li>Settings</li>
                </ul>
            </nav>

            {/* Main Content */}
            <div className="main-content">
                <h1>Admin Dashboard</h1>

                <div className="grid-container">
                    {/* User Management */}
                    <div className="grid-item">
                        <h2>Admin Users</h2>
                        <table>
                            <thead>
                                <tr>
                                    <th>Name</th>
                                    <th>Email</th>
                                    <th>Actions</th>
                                </tr>
                            </thead>
                            <tbody>
                                {currentUsers.map((user, idx) => (
                                    <tr key={idx}>
                                        <td>{user.name}</td>
                                        <td>{user.email}</td>
                                        <td>
                                            <button onClick={() => editUser(idx)}>Edit</button>
                                            <button onClick={() => toggleUserStatus(idx)}>
                                                {user.active ? "Disable" : "Enable"}
                                            </button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                        <div className="pagination">
                            <button onClick={prevPage} disabled={currentPage === 1}>Previous</button>
                            <span> Page {currentPage} of {totalPages} </span>
                            <button onClick={nextPage} disabled={currentPage === totalPages}>Next</button>
                        </div>
                        <a href="#" className="add-user-link">Add User</a>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AdminDashboard;
